def adi_part5(n: int, X: List[List[int]], A: List[List[int]], B: List[List[int]]) -> List[List[int]]:
    return matrix_row_slice(
        matrix_elemwise_sub(
            B,
            matrix_elemwise_div(
                matrix_elemwise_mul(A, A),
                matrix_where(
                    matrix_row_slice(B, 0, len(B) - 1),
                    matrix_row_slice(B, 1, len(B)),
                    lambda x, y: y
                )
            )
        ),
        1,
        n
    )
